// import CoderCard2 from "../../components/CoderCard2/CoderCard2.jsx";
export default function CPStats() {
    return (
        <div className="wrapper_cp">
            <TopicName></TopicName>
            <div className="cp-stats sec s3">

                <div className="cpcard-list">
                    {/* <CPcard
                    web={"LeetCode"}
